import React, { Component } from "react";
import "./alert-popup.css";

import carCrashIcon from "../assert/car-crash-icon.png";

class AlertPopup extends Component {
  state = {
    recent: {
      key: 1,
      location: "Location",
      licenseNo: "License No.",
      patientName: "Patient name",
      date: "Date",
      descript: [
        {
          key: 1,
          title: "License",
          text: "Lorem ipsum dolor sit amet"
        },
        {
          key: 2,
          title: "Medical condition",
          text:
            "Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec quam felis,"
        },
        {
          key: 3,
          title: "Location",
          text: "Lorem ipsum dolor sit amet"
        }
      ]
    }
  };
  render() {
    return (
      <div className="alert-popup">
        <div className="background-blur" />
        <div className="popup-box">
          <div className="img-container">
            <img src={carCrashIcon} alt="" />
          </div>
          <div className="content">
            <div className="top-section">
              <div className="title">{this.state.recent.patientName}</div>
              <div className="date">{this.state.recent.date}</div>
            </div>
            <div className="middle-section">
              <span>Patient Name</span>, License No.
            </div>
            <div className="button-section">
              <button>Hello</button>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default AlertPopup;
